<p dir="auto">Interactive 3D / 2D webgl-accelerated scatter plot point renderer. Core functionality from the <a href="http://projector.tensorflow.org" rel="nofollow">embedding projector</a>, capable of rendering and interacting with tens of thousands of points.</p>
